import React from "react";
import { Link } from "react-router-dom";

import {
  Navbar as NavBar,
  Nav,
  Form,
  FormControl,
  Button,
  NavDropdown,
} from "react-bootstrap";

const Navbar = () => {
  return (
    <>
      <NavBar
        collapseOnSelect
        className="justify-content-center"
        bg="light"
        variant="light"
        fill
        expand="lg"
      >
        <NavBar.Toggle aria-controls="basic-navbar-nav" />

        <NavBar.Collapse >
          <NavBar.Brand href="/">FauxBnB</NavBar.Brand>
          <NavBar.Toggle aria-controls="responsive-navbar-nav" />
          <Nav className="ml-auto">
            <Nav.Item>
              <Nav.Link>
                <Link to="/posts">Posts</Link>
              </Nav.Link>
            </Nav.Item>
          </Nav>
          <NavDropdown title="Want to Host?" id="basic-nav-dropdown">
            <NavDropdown.Item href="/users/signup">Signup</NavDropdown.Item>
            <NavDropdown.Item href="/users/login">Login</NavDropdown.Item>
            <NavDropdown.Item href="/posts/new">
              Add a new place
            </NavDropdown.Item>
          </NavDropdown>

          <Form inline>
            <FormControl
              type="text"
              className="mr-sm-2"
              placeHolder="Start your search"
            />
            <Button variant="outline-dark">Search</Button>
          </Form>
        </NavBar.Collapse>
      </NavBar>
    </>
  );
};

//   <Nav className="ml-auto">

//     <Nav.Item>
